    [],nt"num_tags": 3,nt"name": "monte-vista-national-wildlife-refuge-narrative-report-may-to-august-1955",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Monte Vista National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1955.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    furbearers, predators, rodents, mammals, raptors, fish, and disease- is also covered.
    The Refuge development and maintenance section discusses physical developments.
    Resource management is outlined; topics include grazing and haying. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, and Refuge participation.
    N-R forms and photographs are attached",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
